    async def simulate_serial_data(
            self
    ):
        """
        Read data from a serial port
    
        :param callback: 
        :param command: Command to send
        :param length_fixed: Fixed length of the data, if not set it will be read from the data
        :return: Data read from the serial port
        """
        ser = None  # Initialize ser to None
        try:
            with serial.Serial(self._serial_port, baudrate=self._serial_baud, timeout=0.2) as ser:
                await self.simulate_serialport_data(ser)

        except serial.SerialException as e:
            logger.error(e)
            if ser is not None:
                # close the serial port if it was opened
                ser.close()
                logger.error("Serial port closed")
            else:
                logger.error("Serial port could not be opened")

        except Exception:
            (
                exception_type,
                exception_object,
                exception_traceback,
            ) = sys.exc_info()
            file = exception_traceback.tb_frame.f_code.co_filename
            line = exception_traceback.tb_lineno
            logger.error(f"Exception occurred: {repr(exception_object)} of type {exception_type} in {file} line #{line}")

    async def simulate_serialport_data(
            self,
            ser: serial.Serial,
    ):
        try:
            while not self.shutdown:
                for cmd in self.cmds:
                    logger.info(cmd)
                    self.sendBMSCommand(ser, cmd)
                    if self.shutdown:
                        return
                    await asyncio.sleep(0.1)
    
        except serial.SerialException as e:
            logger.error(e)
            return
    
        except Exception:
            (
                exception_type,
                exception_object,
                exception_traceback,
            ) = sys.exc_info()
            file = exception_traceback.tb_frame.f_code.co_filename
            line = exception_traceback.tb_lineno
            logger.error(f"Exception occurred: {repr(exception_object)} of type {exception_type} in {file} line #{line}")
            return